double gauss(
double x)     /* an xcoordinate in (G_MIN, G_MAX) */
{
   double diff;
   int    ndiff;
   double base;

/* The gaussian has been tabulated in x - steps of G_STEP for */
/* values between -G_MIN and G_MAX                            */

   if (x < G_MIN)
      return(0.0);

   if (x >= G_MAX)
      return(1.0);

/* Compute the table index ndiff */

   diff  =  x - G_MIN;
   diff *= G_SCALE;
   ndiff = diff;

   if (ndiff >= G_COUNT)
      return(1.0);

/* Lookup value and perform linear interpolation */

   base = tabgauss[ndiff];
   base += (tabgauss[ndiff + 1] - base) * (diff - ndiff) / G_SCALE;

   return(base);
}

static double genrand()
{
   double v;

   sval = random();
   v = sval;
   v = v / (1.0 + 0x7fffffff);
   return (v);     /* a uniform random variable in (0, 1) */
}

/**/
/* Returns the value of the inverse of Gaussian distribution */
/* function... Thus the input value must be in  0, 1  and    */
/* the the output value will be in  G_MIN, G_MAX             */

double Fz_inv(
double x)
{
   int count;
   double *base;
   double value;
   double diff;

/* The basic strategy is a binary search of the table */
/* with linear interpolation as a final step.         */

   count = sizeof(tabgauss)/sizeof(double) - 1;
   base  = tabgauss;

/* Continue until the table element just below or equal  */
/* to the input value is identified... Don't worry about */
/* early out.  Also we ARE aware that one less iteration */
/* of the loop could be made if we took advantage of     */
/* symmetry.                                             */

   while (count >= 2)
   {
   /* Adjust current search base upward if new base will */
   /* still be <= target.                                */

      if (*(base + count / 2) <= x)
         base += count / 2;

      count /= 2;
   }

/* First set the output value to the index of the identified */
/* nearest table element.  G_SCALE is the number of table    */
/* elements per unit distance so the divide produces an      */
/* a correct offset in x-axis units from the G_MIN           */

   value = base - tabgauss;
   value /= G_SCALE;

/* If the input value (x) doesn't hit the target exactly */
/* then the output value is linearly incremented         */

   diff  = *(base + 1) - *base;
   value +=  (x - *base) / diff / G_SCALE;

/* G_MIN is negative so this is a subtraction */

   value += G_MIN;

  return(value);


}

/* Returns a random variable from ths standard normal  */
/* (gaussian) distribution.                            */

double gaussian()
{
   double v = genrand();
   v = Fz_inv(v);
   return(v);
}
